import React from "react";
import logo from "../img/entur_logo.jpg";
import Select from "react-select";

class NavBar extends React.Component {

    handleChange = () => {
        console.log('trykka');
    };

    returnOptions = () => {
        return this.props.user.map(item => (
          { label: item.name, value: item.id}
        ))
    };

    render() {
        return (
            <nav className="navBar">
                <div className="padding">
                    <a href="/"><img src={logo} width={140} height={60} alt="Entur" /></a>
                    <div className='select-organization'>
                        <Select placeholder={this.props.user[0].id}
                                onChange={this.handleChange()}
                                options={this.returnOptions()}
                        />
                    </div>
                    <div className='login' id="login">
                        <a href={this.props.logout}><h6 className="text-center text-white">LOGG UT</h6></a>
                    </div>
                </div>
            </nav>
        )
    }
}

export default NavBar;
